import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

function Files() {
  return (
    <div class="files_wrapper">
      <div class="item">
        1
      </div>

      <div class="item">
        2
      </div>

      <div class="item">
        3
      </div>

      <div class="item">
        4
      </div>
    </div>
  )
}

function Login_form_html(){
  return(
    <div className="login_wrapper">
      <h3>Вход</h3>

      <div class="inputs">
        <div class="input_wrapper">
          <p>Логин: </p>
          <input
            class="login"
            placeholder='type login here'
            type="email"
            onChange={(e) => setLogin(e.target.value)} />
        </div>

        <div class="input_wrapper">
          <p>Пароль: </p>
          <input placeholder='type password here'
            class="pwd"
            type="password"
            onChange={(e) => setPwd(e.target.value)} />
        </div>
      </div>

      <button class="submit-btn" onClick={login_confirm}>Войти</button>
    </div>
  )
}

function Login_form() {
  return (
    <div>
      {renderFiles && <Files />}
      {!renderFiles && <Login_form_html/>}
    </div>
  )
}

function Header() {
  return (
    <div class="header_wrapper">
      <div class="header">
        <div class="item">
          <p>data storage</p>
        </div>

        <div class="item">
          <a href='/about'>о проекте</a>
        </div>

        <div class="item">
          <a href='/'>profile</a>
        </div>
      </div>
    </div>
  )
}

function App() {
  return (
    <div>
      <Header />
      <div class="main">
        <Login_form />
      </div>
    </div>
  );
}

export default App;
